INSERT INTO `entities` VALUES (1,'Entidades','nada',1,NULL,NULL,1,410,0,NULL),(57,'(AIG) Autoridad Nacional para la Innovación Gubernamental','La Autoridad Nacional para la Innovación Gubernamental, es la entidad responsable de la modernización del Estado, mediante el uso de las Tecnologías de Información y Comunicaciones (TICs).\n\nProyectos como la Red Internet para Todos (RNI), la operación del 3-1-1 y del Centro de Atención Ciudadana, el sistema informático que respalda la implantación del Sistema Penal Acusatorio (SPA), los trámites electrónicos de los ciudadanos con el Estado, un Panamá Sin Papel (PSP), el despliegue de computadoras en las aulas de clases, los sistemas de citas médicas y expedientes electrónicos, las ventanillas únicas para la atención a los inversionistas y los exportadores, los nuevos sistemas para pasaportes, seguridad ciudadana, procesos aduanales y de finanzas públicas, son algunos ejemplos de los más de 142 proyectos que adelanta la Autoridad Nacional para la Innovación Gubernamental con el fin de dar servicios de calidad, con diligencia y transparencia a la ciudadanía.',1,'http://www.innovacion.gob.pa','AIGlogo_0373740001421253320.png',126,173,1,6),(58,'Consejo Nacional para la Innovación Gubernamental (CNIG)','',1,NULL,NULL,127,172,57,NULL),(59,'Administrador General','',1,NULL,NULL,128,171,58,NULL),(60,'Oficina de Asesoría Legal','',1,NULL,NULL,129,142,59,NULL),(61,'Oficina de Cooperación Internacional','',1,NULL,NULL,143,144,59,NULL),(62,'Oficina de Auditoría Interna','',0,NULL,NULL,145,146,59,NULL),(63,'Oficina de Fiscalización de la Contraloría General','',1,NULL,NULL,147,148,59,NULL),(64,'Oficina de Fiscalización de la Contraloría General','',0,NULL,NULL,149,150,59,NULL),(65,'Dirección de Finanzas','',1,NULL,NULL,151,152,59,NULL),(66,'Dirección de Administración Ejecutiva','',1,NULL,NULL,153,154,59,NULL),(67,'Dirección Nacional Arquitectura Tecnológica','',1,NULL,NULL,155,156,59,NULL),(68,'Dirección Nacional Innovación Gubernamental','',1,NULL,NULL,157,158,59,NULL),(69,'Dirección Nacional Gobierno Digital','',1,NULL,NULL,159,160,59,NULL),(70,'Dirección Nacional Tecnología y Transformación','',1,NULL,NULL,161,162,59,NULL),(71,'Dirección Tecnológica y Sistemas','',1,NULL,NULL,163,164,59,NULL),(72,'Dirección ITI','',1,NULL,NULL,165,166,59,NULL),(73,'Dirección RNI','',1,NULL,NULL,167,168,59,NULL),(74,'Dirección Atención Ciudadana 311','',1,NULL,NULL,169,170,59,NULL),(75,'Ministerio de Economía y Finanzas (MEF)','El Ministerio de Economía y Finanzas, conocido por sus siglas como MEF, inicia su vida institucional en los primeros años de historia republicana, debido a que es el resultado de la integración del Ministerio de Hacienda y Tesoro y del Ministerio de Planificación y Política Económica.\n\nDe parte del Ministerio de Hacienda y Tesoro su creación se origina el 12 de noviembre de 1903, cuando la Junta Provisional de Gobierno, conformada por José Agustín Arango, Tomás Arias y Manuel Espinosa Batista, firman el decreto ejecutivo número 1 que reglamenta el servicio del Ministerio de Hacienda, siendo su primer ministro, Manuel Encarnación Amador. En ese primer momento patrio lo que se buscaba era organizar las estructuras del estado, en aspectos como los ingresos, el cobro de los impuestos comerciales, de licores, la renta por importación del opio y los juegos de suerte y azar. Así como hacerle frente a las abruptas transformaciones que encaraba el país debido al reinicio de los trabajos de excavación del canal interoceánico. Noventa y cinco años después orientado a la política fiscal y financiera del país, administrando el sistema tributario y el régimen aduanero de la República , así como custodiando los bienes nacionales, el Ministerio de Hacienda y Tesoro, dio el paso siguiente de su modernización y tecnificación.\n\nPor parte del Ministerio de Planificación y Política Económica, conocido por sus siglas como MIPPE, la historia es más reciente. Es hasta que se organiza el despacho de la Presidencia de la República el 16 de noviembre de 1956 que se crea el Departamento de Planificación, que dos años más tarde conforma el Ministerio de la Presidencia. Un año después, en 1959, se crea la Dirección General de Planificación y Administración de la Presidencia y el Departamento de Planificación mediante los decretos leyes 11 y 12, siendo su primer director el ingeniero David Samudio. En el proceso evolutivo y de desarrollo del país, la Dirección General de Planificación y Administración de la Presidencia requería ser una entidad planificadora, coordinadora y orientadora del desarrollo económico y social del país para que por la vía del fortalecimiento y diversificación de la producción y el desarrollo regional, se acrecentara la riqueza y el ingreso nacional en beneficio de todos los panameños. Así se crea mediante la Ley N °.16 de 28 de febrero de 1973 el Ministerio de Planificación y Política Económica. Fue su primer ministro, Nicolás Ardito Barletta.\n\nPor 25 años el MIPPE preparó los planes nacionales de desarrollo económico y social, diseñó y formuló las políticas económicas y sociales, coordinó los programas de desarrollo, dirigió la administración presupuestaria, organizó la administración de personal, gestionó y negoció el financiamiento externo, la cooperación técnica y administró los fondos del Gobierno Nacional, hasta que se transforman sus funciones para hacer el manejo administrativo gubernamental de la cosa pública más eficiente y eficaz. A finales de 1998 las transformaciones requeridas tanto por el Ministerio de Hacienda y Tesoro, como de Planificación y Política Económica toma forma ante la Asamblea Legislativa y mediante la Ley 97 de 21 de diciembre se aprueba la creación del Ministerio de Economía y Finanzas, oficializándose la fusión de los Ministerios de Planificación y Política Económica y de Hacienda y Tesoro. El Ministerio de Economía y Finanzas se crea con el propósito de transformar la Administración Pública y a fin de dar mayor coherencia e integralidad a la gestión financiera y presupuestaria del Estado, así como brindar una mayor definición y coordinación de las políticas económicas, fiscales y sociales. Su primer ministro fue Fernando Aramburu Porras.\n\nEl Ministerio de Economía y Finanzas (MEF) tiene a su cargo todo lo relacionado a la formulación de iniciativas en materia de política económica; la programación de las inversiones públicas y la estrategia social, el diseño y ejecución de las directrices generales y las tareas específicas del Gobierno sobre Hacienda y Tesorería Nacional; la elaboración, ejecución y control del Presupuesto General del Estado, Crédito Público y modernización del Estado, así como la elaboración y ejecución de la Programación .',1,'www.mef.gob.pa','',174,249,1,8),(76,'Consejo de Coordinación Financiera de la República de Panamá','',0,NULL,NULL,175,176,75,NULL),(77,'Ministro(a)','',1,NULL,NULL,177,178,75,NULL),(78,'Consejo de Coordinación Financiera de la República de Panamá','',1,NULL,NULL,179,180,75,NULL),(79,'Consejo Económico Nacional','',1,NULL,NULL,181,182,75,NULL),(80,'Viceministerio de Economía','',1,NULL,NULL,183,212,75,NULL),(81,'Viceministerio de Finanzas','',1,NULL,NULL,213,232,75,NULL),(82,'Secretaría General','',1,NULL,NULL,233,234,75,NULL),(83,'Oficina de Asesoría Legal','',1,NULL,NULL,235,236,75,NULL),(84,'Oficina de Relaciones Públicas','',1,NULL,NULL,237,238,75,NULL),(85,'Oficina de Auditoría Interna','',1,NULL,NULL,239,240,75,NULL),(86,'Oficina de Fiscalización de la Contraloría General de la República','',1,NULL,NULL,241,242,75,NULL),(87,'Dirección de Administración y Finanzas','',1,NULL,NULL,243,244,75,NULL),(88,'Dirección de Tecnología e Informática','',1,NULL,NULL,245,246,75,NULL),(89,'Oficina Institucional de Recursos Humanos','',1,NULL,NULL,247,248,75,NULL),(90,'Fondo de Preinversión','',1,NULL,NULL,184,185,80,NULL),(91,'Comisión Mixta para Centro América','',1,NULL,NULL,186,187,80,NULL),(92,'Comisión Arancelería','',1,NULL,NULL,188,189,