ara coadyuvar a la Modernización del Estado, a través del Proyecto Panamá sin\nPapel, ha desarrollado una plataforma tecnológica de Correspondencia Estatal,\nla cual permitirá que todas las comunicaciones que se efectúen a lo interno de\nlas instituciones o entre ellas, se realicen de forma digital y segura mediante\nel uso de firma electrónica, reduciendo considerablemente los costos operativos\ndel proceso de mensajería y los tiempos en los procesos gubernamentales, como\nlos de aprobaciones de viáticos al extranjero, el cual es un módulo de la\nherramienta.<o:p></o:p></span></p>\n\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\njustify;text-justify:inter-ideograph;line-height:normal\"><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span></p>\n\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\njustify;text-justify:inter-ideograph;line-height:normal\"><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\">Queremos\ncontar con la valiosa e indispensable colaboración, para iniciar con&nbsp; el proceso de presentación de la Plataforma\nde Correspondencia Estatal en el Ministerio que usted preside y posteriormente\niniciar la implementación en todas las entidades públicas. Para tal efecto,\nagradecemos la designación de un personal para demostrar las bondades del sistema\nque optimizará de seguro espacios en áreas de archivos, disminuir tiempo y\ncostos operativos que se incurren en la mensajería interna y externa de las\nEntidades.<o:p></o:p></span></p>\n\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\njustify;text-justify:inter-ideograph;line-height:normal\"><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span></p>\n\n<p class=\"MsoNormal