a-margin-bottom:8.0pt;\n	mso-para-margin-left:0cm;\n	line-height:107%;\n	mso-pagination:widow-orphan;\n	font-size:11.0pt;\n	font-family:\"Calibri\",\"sans-serif\";\n	mso-ascii-font-family:Calibri;\n	mso-ascii-theme-font:minor-latin;\n	mso-hansi-font-family:Calibri;\n	mso-hansi-theme-font:minor-latin;\n	mso-fareast-language:EN-US;}\n</style>\n<![endif]-->\n\n<p class=\"MsoNormal\"><span style=\"font-size:13.5pt;line-height:107%;font-family:\n&quot;Trebuchet MS&quot;,&quot;sans-serif&quot;;color:black\">\"<span style=\"box-sizing: border-box\"><span class=\"apple-converted-space\">&nbsp;</span></span></span><i style=\"box-sizing: border-box\"><span style=\"font-size:10.0pt;line-height:107%;\nfont-family:&quot;Trebuchet MS&quot;,&quot;sans-serif&quot;;color:black\">Hubo una tierra de\ncaballeros y campos de algodón llamada el Antiguo Sur. En este bonito mundo, el\nvalor hizo su última reverencia. Aquí fueron vistos los últimos reyes y sus\nbellas damas, de amos y de esclavos. Vistos ahora sólo en libros, ya que no es más\nque el recuerdo de un sueño, una civilización que el viento se llevó.<span class=\"apple-converted-space\"><span style=\"box-sizing: border-box\">&nbsp;</span></span><br style=\"box-sizing: border-box\">\n(...)<br style=\"box-sizing: border-box\">\nScarlett O\'Hara no era bella, pero poco lo notaban los hombres cuando eran\natrapados por sus encantos como los gemelos Tarleton lo fueron. En su rostro se\nmezclaban bruscamente los delicados rasgos de su madre, una aristócrata costera\nde ascendencia francesa, y los pesados rasgos de su pintoresco padre irlandés.\nPero era una cara que atrapaba, de barbilla puntiaguda, y mandibula cuadrada.\nSus ojos eran de un verde pálido sin un toque de almendra, estrellados con\nerizadas pestañas negras y ligeramente inclinadas al final. Sobre ellas sus\ngruesas cejas oscuras inclinadas hacia arriba, producían una asustadiza línea\noblicua en su piel blanca de magnolia, esa piel tan apreciada por las mujeres\ndel sur y tan cuidadosamente guardada con sombreros, velos y guantes del\ncaliente sol de Georgia.<span class=\"apple-converted-space\"><span style=\"box-sizing: border-box\">&nbsp;</span></span></span></i><span style=\"font-size:13.5pt;line-height:107%;font-family:&quot;Trebuchet MS&quot;,&quot;sans-serif&quot;;\ncolor:black\"><span style=\"box-sizing: border-box;orphans: auto;text-align:start;\nwidows: 1;-webkit-text-stroke-width: 0px;float:none;word-spacing:0px\">\"</span></span></p>\n\n',0,'2015-05-26 13:49:55','2015-05-26 13:49:55',0),(595,'comunicación con adjunto con fecha de vencimiento sin firma','<!--[if gte mso 9]><xml>\n <o:OfficeDocumentSettings>\n  <o:AllowPNG/>\n </o:OfficeDocumentSettings>\n</xml><![endif]--><!--[if gte mso 9]><xml>\n <w:WordDocument>\n  <w:View>Normal</w:View>\n  <w:Zoom>0</w:Zoom>\n  <w:TrackMoves/>\n  <w:TrackFormatting/>\n  <w:HyphenationZone>21</w:HyphenationZone>\n  <w:PunctuationKerning/>\n  <w:ValidateAgainstSchemas/>\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\n  <w:DoNotPromoteQF/>\n  <w:LidThemeOther>ES</w:LidThemeOther>\n  <w:LidThemeAsian>X-NONE</w:LidThemeAsian>\n  <w:LidThemeComplexScript>X-NONE</w:LidThemeComplexScript>\n  <w:Compatibility>\n   <w:BreakWrappedTables/>\n   <w:SnapToGridInCell/>\n   <w:WrapTextWithPunct/>\n   <w:UseAsianBreakRules/>\n   <w:DontGrowAutofit/>\n   <w:SplitPgBreakAndParaMark/>\n   <w:EnableOpenTypeKerning/>\n   <w:DontFlipMirrorIndents/>\n   <w:OverrideTableStyleHps/>\n  </w:Compatibility>\n  <m:mathPr>\n   <m:mathFont m:val=\"Cambria Math\"/>\n   <m:brkBin m:val=\"before\"/>\n   <m:brkBinSub m:val=\"&#45;-\"/>\n   <m:smallFrac m:val=\"off\"/>\n   <m:dispDef/>\n   <m:lMargin m:val=\"0\"/>\n   <m:rMargin m:val=\"0\"/>\n   <m:defJc m:val=\"centerGroup\"/>\n   <m:wrapIndent m:val=\"1440\"/>\n   <m:intLim m:val=\"subSup\"/>\n   <m:naryLim m:val=\"undOvr\"/>\n  </m:mathPr></w: