se\nmezclaban bruscamente los delicados rasgos de su madre, una aristócrata costera\nde ascendencia francesa, y los pesados rasgos de su pintoresco padre irlandés.\nPero era una cara que atrapaba, de barbilla puntiaguda, y mandibula cuadrada.\nSus ojos eran de un verde pálido sin un toque de almendra, estrellados con\nerizadas pestañas negras y ligeramente inclinadas al final. Sobre ellas sus\ngruesas cejas oscuras inclinadas hacia arriba, producían una asustadiza línea\noblicua en su piel blanca de magnolia, esa piel tan apreciada por las mujeres\ndel sur y tan cuidadosamente guardada con sombreros, velos y guantes del\ncaliente sol de Georgia.<span class=\"apple-converted-space\"><span style=\"box-sizing: border-box\">&nbsp;</span></span></span></i><span style=\"font-size:13.5pt;line-height:107%;font-family:&quot;Trebuchet MS&quot;,&quot;sans-serif&quot;;\ncolor:black\"><span style=\"box-sizing: border-box;orphans: auto;text-align:start;\nwidows: 1;-webkit-text-stroke-width: 0px;float:none;word-spacing:0px\">\"</span></span></p>\n\n',0,'2015-05-26 13:54:50','2015-05-26 13:54:50',0),(596,'comunicación con adjunto con fecha de vencimiento con firma','<!--[if gte mso 9]><xml>\n <o:OfficeDocumentSettings>\n  <o:AllowPNG/>\n </o:OfficeDocumentSettings>\n</xml><![endif]--><!--[if gte mso 9]><xml>\n <w:WordDocument>\n  <w:View>Normal</w:View>\n  <w:Zoom>0</w:Zoom>\n  <w:TrackMoves/>\n  <w:TrackFormatting/>\n  <w:HyphenationZone>21</w:HyphenationZone>\n  <w:PunctuationKerning/>\n  <w:ValidateAgainstSchemas/>\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\n  <w:DoNotPromoteQF/>\n  <w:LidThemeOther>ES</w:LidThemeOther>\n  <w:LidThemeAsian>X-NONE</w:LidThemeAsian>\n  <w:LidThemeComplexScript>X-NONE</w:LidThemeComplexScript>\n  <w:Compatibility>\n   <w:BreakWrappedTables/>\n   <w:SnapToGridInCell/>\n   <w:WrapTextWithPunct/>\n   <w:UseAsianBreakRules/>\