libri;\n	mso-ascii-theme-font:minor-latin;\n	mso-hansi-font-family:Calibri;\n	mso-hansi-theme-font:minor-latin;\n	mso-fareast-language:EN-US;}\n</style>\n<![endif]-->\n\n<p class=\"MsoNormal\"><span style=\"font-size:13.5pt;line-height:107%;font-family:\n&quot;Trebuchet MS&quot;,&quot;sans-serif&quot;;color:black\">\"<span class=\"apple-converted-space\">&nbsp;</span></span><i><span style=\"font-size:10.0pt;\nline-height:107%;font-family:&quot;Trebuchet MS&quot;,&quot;sans-serif&quot;;color:black\">Hubo una\ntierra de caballeros y campos de algodón llamada el Antiguo Sur. En este bonito\nmundo, el valor hizo su última reverencia. Aquí fueron vistos los últimos reyes\ny sus bellas damas, de amos y de esclavos. Vistos ahora sólo en libros, ya que\nno es más que el recuerdo de un sueño, una civilización que el viento se llevó.<span class=\"apple-converted-space\">&nbsp;</span><br>\n(...)<br>\nScarlett O\'Hara no era bella, pero poco lo notaban los hombres cuando eran\natrapados por sus encantos como los gemelos Tarleton lo fueron. En su rostro se\nmezclaban bruscamente los delicados rasgos de su madre, una aristócrata costera\nde ascendencia francesa, y los pesados rasgos de su pintoresco padre irlandés.\nPero era una cara que atrapaba, de barbilla puntiaguda, y mandibula cuadrada.\nSus ojos eran de un verde pálido sin un toque de almendra, estrellados con\nerizadas pestañas negras y ligeramente inclinadas al final. Sobre ellas sus\ngruesas cejas oscuras inclinadas hacia arriba, producían una asustadiza línea\noblicua en su piel blanca de magnolia, esa piel tan apreciada por las mujeres\ndel sur y tan cuidadosamente guardada con sombreros, velos y guantes del\ncaliente sol de Georgia.<span class=\"apple-converted-space\">&nbsp;</span></span></i><span style=\"font-size:13.5pt;line-height:107%;font-family:&quot;Trebuchet MS&quot;,&quot;sans-serif&quot;;\ncolor:black\">\"</span></p>\n\n',0,'2015-06-02 10:06:59','2015-06-02 10:06:59',0),(603,'comunicación con adjunto sin f