guage:ES;mso-fareast-language:\nEN-US;mso-bidi-language:AR-SA\">Scarlett O\'Hara no era bella, pero poco lo\nnotaban los hombres cuando eran atrapados por sus encantos como los gemelos\nTarleton lo fueron. En su rostro se mezclaban bruscamente los delicados rasgos\nde su madre, una aristócrata costera de ascendencia francesa, y los pesados\nrasgos de su pintoresco padre irlandés. Pero era una cara que atrapaba, de\nbarbilla puntiaguda, y mandibula cuadrada. Sus ojos eran de un verde pálido sin\nun toque de almendra, estrellados con erizadas pestañas negras y ligeramente\ninclinadas al final. Sobre ellas sus gruesas cejas oscuras inclinadas hacia\narriba, producían una asustadiza línea oblicua en su piel blanca de magnolia,\nesa piel tan apreciada por las mujeres del sur y tan cuidadosamente guardada\ncon sombreros, velos y guantes del caliente sol de Georgia.<span class=\"apple-converted-space\">&nbsp;</span></span></i><span style=\"font-size:\n13.5pt;line-height:107%;font-family:&quot;Trebuchet MS&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\nCalibri;mso-fareast-theme-font:minor-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;\nmso-bidi-theme-font:minor-bidi;color:black;mso-ansi-language:ES;mso-fareast-language:\nEN-US;mso-bidi-language:AR-SA\">\"</span>',0,'2015-07-02 09:43:37','2015-07-02 09:43:37',0),(642,'Enviar nueva comunicación con adjunto con fecha de vencimiento sin firma','<!--[if gte mso 9]><xml>\n <o:OfficeDocumentSettings>\n  <o:AllowPNG/>\n </o:OfficeDocumentSettings>\n</xml><![endif]--><!--[if gte mso 9]><xml>\n <w:WordDocument>\n  <w:View>Normal</w:View>\n  <w:Zoom>0</w:Zoom>\n  <w:TrackMoves/>\n  <w:TrackFormatting/>\n  <w:HyphenationZone>21</w:HyphenationZone>\n  <w:PunctuationKerning/>\n  <w:ValidateAgainstSchemas/>\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\n  <w:DoNotPromoteQF/>\n  <w:LidThemeOther>ES<